USE dataEntry3C;

DROP TABLE IF EXISTS      dbo.manuelleEinsparungen;
GO

CREATE TABLE 
	dbo.manuelleEinsparungen
(
	processIdOriginal			BIGINT NOT NULL,
	processIdKorrektur			BIGINT NOT NULL,
	prueferId					BIGINT NOT NULL,
	umgesetzteEinsparung		NUMERIC(12,2) NOT NULL,
	kommentar					VARCHAR(512) NULL,
	erfasser					VARCHAR(50) NOT NULL,
	erfassungszeitpunkt			DATETIME2(0) NOT NULL,
	aktualisierungszeitpunkt	DATETIME2(0) NULL,
	CONSTRAINT me_pk PRIMARY KEY CLUSTERED
	(
		  processIdOriginal,
          processIdKorrektur
	)
);

GO

 
INSERT INTO dbo.manuelleEinsparungen
(
    processIdOriginal,
    processIdKorrektur,
    prueferId,
    umgesetzteEinsparung,
    kommentar,
    erfasser,
    erfassungszeitpunkt,
    aktualisierungszeitpunkt
)
VALUES
(   10100,             -- processIdOriginal - bigint
    10101,             -- processIdKorrektur - bigint
    2,             -- prueferId - bigint
    1234.12,             -- umgesetzteEinsparung - numeric(12, 2)
    NULL,          -- kommentar - varchar(500)
    'RZN\3c.chef.pruefer',            -- erfasser - varchar(50)
    SYSDATETIME(), -- erfassungszeitpunkt - datetime2(0)
    NULL           -- aktualisierungszeitpunkt - datetime2(0)
    ) 
    ;
    GO


          
